using (SqlConnection connection = new SqlConnection(connectionString))\n{\n    connection.Open();\n\n    string insertStatement = "INSERT INTO YourTable (Column1, Column2) VALUES (@Column1, @Column2)";\n\n    SqlCommand command = new SqlCommand(insertStatement, connection);\n\n    foreach (var item in yourData)\n    {\n        command.Parameters.Clear();\n        command.Parameters.AddWithValue("@Column1", item.Column1);\n        command.Parameters.AddWithValue("@Column2", item.Column2);\n\n        command.ExecuteNonQuery();\n    }\n}